  false,\n\t\"url\": null,\n\t\"notes\": \"Preliminary report on the geology of southern
  Snohomish County, Open File Report  73-1.nThe map area includes eighty-five square
  miles in South SnohomishnCounty southeast of Everett, bounded on the west by Interstate
  5, on thensouth by Highway 405 and the Snohomish-King County boundary, on theneast
  and north by the Snohomish River floodplain.nThe purpose of the project is to provide
  a geologic map of the areanat a scale which can be useful as a tool in urban planning.
  Since thenproject has been done in conjunction with the Snohomish County PlanningnCommission,
  hopefully, it will provide geologic data that will be usefulnto them in planning
  for future metropolitan and industrial growth. Thengeologic map will provide a basis
  for applying groundwater, seismic response,nslope stability and engineering property
  studies to the area, allnof which are important factors in today's urban and regional
  planning.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
